import {City} from './City';

export class Courier {
  // tslint:disable-next-line:variable-name
  courier_id: bigint;
  // tslint:disable-next-line:variable-name
  courier_first_name: string;
  // tslint:disable-next-line:variable-name
  courier_last_name: string;
  // tslint:disable-next-line:variable-name
  // tslint:disable-next-line:variable-name
  courier_phone: string;
  // tslint:disable-next-line:variable-name
  courier_city_name: string;
}
